Congrats to Team GLOCK for continuing to pursue perfection at the USPSA Area 7 Championship in Dunbarton, NH!
@Shane_Coley won High Overall in Limited Division shooting his G24 and @Ashley_Rheuark won High Lady in Carry Optics Division shooting her G34 Gen5 MOS. 

